import { Col } from "react-bootstrap";
import { Download, Github, Link45deg } from "react-bootstrap-icons";

export const ProjectCard = ({ title, description, imgUrl,liveUrl, gitUrl }) => {
  return (
    <Col size={12} sm={6} md={4}>
      <div className="proj-imgbx">
        <img src={imgUrl} />
        <div className="proj-txtx">
          <h4>{title}</h4>
          <span>{description}</span>
          <br></br>
          <a href="https://drive.google.com/file/d/1fp9gk6sFHUpwnUgtaNAK_qbBNGzvzzpN/view?usp=sharing" target="_blank" rel="noreferrer" style={{ textDecoration: "none" , color:"white" }}>
                  <button>Live<Link45deg size={25} /></button>
            </a>
          {' '}
          <a href="https://drive.google.com/file/d/1fp9gk6sFHUpwnUgtaNAK_qbBNGzvzzpN/view?usp=sharing" target="_blank" rel="noreferrer" style={{ textDecoration: "none" }}>
                <button>Github<Github size={25} /></button>
            </a>
        </div>
      </div>
    </Col>
  )
}
